  type: Method
  assemblies:
  - SoCore
  namespace: SuperOffice.Diagnostics
  summary: Log an operation with properties. Will create a Dependency telemetry item in Application Insights.
  example: []
  syntax:
    content: public IDisposable StartOperation(string operationname, string dependencyTypeName, IDictionary<string, string> tags = null)
    parameters:
    - id: operationname
      type: System.String
      description: Name of operation. Will show up as Name on the Dependency telemetry item in Application Insights.
    - id: dependencyTypeName
      type: System.String
      description: Type of dependency, "InProc | SuperOffice.{xxx}" is the suggested format for this property. Will show up as Type on the Dependency telemetry item in Application Insights
    - id: tags
      type: System.Collections.Generic.IDictionary{System.String,System.String}
      description: Additional properties (key/value-pair, string:string) on the operation. Each pair will show up as a Custom Dimension on the Dependency telemetry item in Application Insights.
    return:
      type: System.IDisposable
      description: An operation tracer. Dispose it to signal end of operation.
